        \ evidence, or illustrate a point.\nKey differences:\n\n* Purpose: The main\
        \ purpose of a citation is to give credit to the original author for their\
        \ work, while the main purpose of a quotation is to convey the exact words\
        \ or phrasing of the original source.\n* Formatting: Citations are typically\
        \ formatted according to a specific citation style (such as MLA, APA, or Chicago),\
        \ while quotations may be formatted differently depending on the context and\
        \ the style being used.\n* Length: Quotations can be longer than citations,\
